(1, 'THANK YOU', 'thank-you', 'THANK_YOU', 0, 'assets/article/thank-you23.jpg', '<div style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 15px; margin-bottom: 1em;\"><span style=\"color:#808080;\"><span style=\"font-family:times new roman,times,serif;\"><tt>Thank you for subscribing with us. We will be more then happy to send you latest offers and updates. Happy GST Billing System.<br />\r\n<br />\r\nIt\'s nice of you to take the time to get to know us better. Here are something about us that we thought you might like to know. You can change your email preferences by visiting the www.freegstbills.com at any time.</tt></span></span></div>', 0, 0, '2019-02-01 12:17:28', '2019-02-05 10:47:58');
