INSERT INTO `content` (`content_id`, `content_category_id`, `c_name`, `c_alias`, `c_client`, `c_sku`, `c_hashtag`, `c_banner`, `c_images`, `c_home_image`, `c_explanation`, `c_short_description`, `c_description`, `c_date`, `column_size`, `is_display_home`, `c_status`, `c_created_date`, `c_modified_date`) VALUES
(3, 2, 'The Foundry', 'the-foundry', 'The Foundry', 'the-foundry', '#TheFoundry #Branding', 'assets/content/banner/foundry1-1.jpg', '', 'assets/content/home/foundry1.jpg', 'The Foundry has become a legend amongst the eateries of Bahrain.', 'c_short_description', 'In 2015, we where approached by the founders to help them develop the concept for a new kind of restaurant in the Kingdom. From our research and strategy, we dug deep and uncovered some great brand truths about the passion and commitment behind the project. The Foundry name was inspired by the sheer determination to be the best and was re-enforced with the strap line  Working hard for food. This in-turn inspired the look and feel for the whole identity, theme and interior design, giving the venue a distinct industrial look and feel and a visual language quite different from anything seen before in Bahrain.', '01/01/2019', 0, 0, 0, '2019-04-24 09:56:13', '2019-04-24 10:12:42'),
(4, 2, 'Maraee  2018', 'maraee-2018', 'Maraee', 'mara-ee-2018', '#Maraee', 'assets/content/banner/1-1.jpg', '', 'assets/content/home/1.jpg', 'Maraee is the biggest animal show in the Kingdom of Bahrain.', 'c_short_description', 'With a huge variety of animals on show, and the ability for the visitors to get really close and interact with the animals, they where quite literally able to get hands on! We developed a mixed channel approach, using both traditional media and a heavy push on social where our targeted strategy saw great success locally and regionally with specific penetration into KSA and Kuwait.', '25/03/2019', 0, 1, 0, '2019-04-24 10:35:28', '2019-04-24 13:40:44'),
(5, 2, 'Jumeirah Royal Saray', 'jumeirah-royal-saray', 'Jumeirah Royal Saray', 'jumeirah-royal-saray', '', 'assets/content/banner/1-11.jpg', '', 'assets/content/home/11.jpg', 'The campaign has been launched using a mix of channels with a weighting towards digital for KSA penetration.', 'c_short_description', 'Miracle worked with the Dubai based hotel group Jumeirah for the launch of their stunning new Luxury hotel Jumeirah Royal Saray Bahrain. Showcasing the beautiful interiors and exteriors, we wanted to position the hotel as the only destination for luxury in Bahrain. the evocative campaign line Where two seas meet, there is one place to be, plays on the meaning of Bahrain (two seas).', '25/03/2019', 0, 0, 0, '2019-04-24 10:53:11', NULL),
(6, 1, 'National Bank of Bahrain', 'national-bank-of-bahrain', 'National Bank of Bahrain', 'national-bank-of-bahrain', '#NationalBankOfBahrain', 'assets/content/banner/1-12.jpg', '', 'assets/content/home/12.jpg', 'NBB (National Bank of Bahrain) Is the Kingdoms leading financial institution.', 'c_short_description', 'NBB (National Bank of Bahrain) Is the Kingdoms leading financial institution. After a successful 3 way pitch Miracle was awarded the Banks leading product Al Watani, save and win campaign. We built the campaign idea around trust, showing the previous winner across all the launch communications who would act as a brand ambassador across all channels, from digital, print to TVCs.', '25/03/2019', 0, 1, 0, '2019-04-24 11:53:21', '2019-04-24 13:41:02'),
(7, 1, 'Hurafuna', 'hurafuna', 'Hurafuna', 'hurafuna', '', 'assets/content/banner/1-13.jpg', '', 'assets/content/home/14.jpg', 'Celebrating the Kingdoms rich and diverse heritage and culture by promoting the concept of open markets and showcasing traditional handicra', 'c_short_description', 'Miracle developed the Identity and collateral for the on going festival. The Hurafuna festival provided visitors with a unique experience; while promoting Bahrains tourism offering and showcasing traditional handicrafts and souks. The festival showcased local handmade goods at stalls erected in Manama Souk, creating awareness of local handicrafts such as basket weaving, production of traditional musical instruments, wooden boxes and pottery among others.', '25/03/2019', 0, 0, 0, '2019-04-24 12:06:38', '2019-04-24 12:08:09'),
(8, 1, 'Kuwait Finance House (KFH)', 'kuwait-finance-house-kfh', 'Kuwait Finance House (KFH)', 'kuwait-finance-house-kfh-', '', 'assets/content/banner/1-14.jpg', '', 'assets/content/home/15.jpg', 'Kuwait Finance House (KFH)', 'c_short_description', 'We have been the incumbent agency for KFH for over 15 years and have worked alongside the Bank to create a brand that is seen as a leader in retail and business Islamic banking. We have developed everything from a corporate brand refresh, a full suite of retail products and campaigns, to branding and launching large investments for the Bank such as Diyar Homes and broadband company, Menatelecom.', '25/03/2019', 0, 0, 0, '2019-04-24 12:37:49', NULL),
(9, 1, 'APM Terminals', 'apm-terminals', 'APM Terminals', 'apm-terminals', '', 'assets/content/banner/1-15.jpg', '', 'assets/content/home/16.jpg', 'Gold at Transform Awards MENA', 'c_short_description', 'From design to production APM Terminals Bahrain entrusted Miracle with the task of developing the 120 page 5-Year Anniversary Book. Presented as a photographic documentary book, which portrays a day in the life of the shipping port. The Photography was mostly shot by our in-house photographer and designed with beautiful design accents reflecting the APM brand.', '25/03/2019', 0, 0, 0, '2019-04-24 13:13:27', NULL),
(10, 1, 'Manama Capital of Tourism', 'manama-capital-of-tourism', 'Manama Capital of Tourism', 'manama-capital-of-tourism', '', 'assets/content/banner/1-16.jpg', '', 'assets/content/home/17.jpg', 'Manama Gulf Capital of Tourism 2016', 'c_short_description', 'Manama Gulf Capital of Tourism 2016', '26/03/2019', 0, 1, 0, '2019-04-24 13:39:31', '2019-05-11 05:53:12'),
(11, 1, 'Seef Properties', 'seef-properties', 'Seef Properties', 'seef-properties', '', 'assets/content/banner/1-17.jpg', '', 'assets/content/home/18.jpg', 'Seef Properties', 'c_short_description', 'Seef Properties', '25/03/2019', 0, 0, 0, '2019-04-24 13:50:41', '2019-04-25 16:27:38');
